result:
.tips {
  float: right;
  color: #8492a6;
  padding-left: 10px;
}
.jsTips {
  -ms-flex-negative: 0;
  flex-shrink: 0;
  padding: 8px 16px;
  background-color: #ecf8ff;
  border-radius: 4px;
  border-left: 5px solid #50bfff;
  font-size: 14px;
  line-height: 24px;
  color: #5e6d82;
}
.jsStaticData {
  flex: 1;
  display: flex;
  overflow: hidden;
  flex-direction: column;
  padding: 10px;
  .json-box {
    flex: 1;
  }
}
.monaco-container {
  height: 100%;
  width: 100%;
  overflow: hidden;
}
.steps {
  width: unset;
  overflow: auto;
  padding: 6px 20px;
  background: #fff;
  justify-items: flex-start;
  .el-step {
    width: 155px;
  }
}
.page-explain {
  cursor: pointer;
  float: right;
  color: #606266;
}
.flow-form-main {
  >>> .main {
    padding: 0 !important;
  }
  >>> .el-tabs__header {
    padding: 0;
    margin-bottom: 0;
    .el-tabs__item {
      line-height: 50px;
    }
  }
  .config {
    flex: 1;
    padding: 10px;
    display: flex;
    justify-content: space-between;
    overflow: hidden;
    .tableData {
      flex-shrink: 0;
      width: 350px;
      .tableDataSelect {
        width: 100%;
      }
      .box {
        margin-top: 8px;
        border-radius: 4px;
        height: calc(100% - 40px);
        border: 1px solid #dcdfe6;
        overflow: hidden;
        .search-box {
          padding: 10px;
        }
        .tree-box {
          height: calc(100% - 52px);
          overflow: auto;
          overflow-x: hidden;
        }
      }
    }
    .api_detail {
      margin-left: 0;
    }
    .detail {
      flex: 1;
      margin: -10px 10px 0 10px;
      overflow: hidden;
      display: flex;
      flex-direction: column;
      .top-box {
        display: flex;
        .main-box {
          flex: 1;
          margin-right: 18px;
        }
      }
      .sql-box {
        border-top: 1px solid #dcdfe6;
        height: calc(100vh - 258px);
        overflow: auto;
      }
    }
  }
  .parameterList {
    padding-left: 110px;
    margin-bottom: 18px;
    >>> .el-icon-edit-outline,
    >>> .el-icon-delete {
      font-size: 16px;
    }
  }
  .middle-pane {
    flex-shrink: 0;
    display: flex;
    flex-direction: column;
    height: 100%;
    overflow: hidden;
    margin-top: 10px;
    .right-pane-list {
      border: 1px solid #dcdfe6;
      border-radius: 4px;
      flex: 1;
      display: flex;
      flex-direction: column;
      margin-bottom: 10px;
      overflow: hidden;
      .requestMethod {
        width: 100%;
        padding: 18px 15px 0;
        border-bottom: 1px solid #dcdfe6;
        >>> .el-select .el-input {
          width: 90px;
        }
        >>> .el-form {
          padding-top: 0;
        }
      }
      .textBlock {
        text-align: left;
        font-size: 14px;
        padding: 18px 15px;
        border-bottom: 1px solid #dcdfe6;
      }
      .tabsBlock {
        >>> .el-tabs__header {
          padding: 0 15px !important;
        }
      }
      .radio-group-block {
        padding: 18px 15px 0;
      }
      .body_txt {
        margin-left: 50px;
        margin-top: 20px;
        color: #606266;
        font-size: 15px;
      }
      .json-block {
        padding: 0 15px 15px;
        width: 100%;
        height: 100%;
        margin-top: 18px;
        .json-block-inner {
          border: 1px solid #dcdfe6;
          width: 100%;
          height: 100%;
          border-radius: 4px;
          font-size: 14px;
          color: #606266;
          .inner-hd {
            padding: 10px;
            display: flex;
            flex-direction: row;
            align-items: center;
            justify-content: space-between;
            border-bottom: 1px solid #dcdfe6;
            .cursor_pointer {
              cursor: pointer;
            }
          }
          .JSONEditor {
            max-height: 450px;
          }
        }
      }
      .cap {
        height: 36px;
        line-height: 36px;
        display: flex;
        color: #606266;
        font-size: 14px;
        padding: 0 10px;
        flex-shrink: 0;
        justify-content: space-between;
        align-items: center;
      }
      .table-actions {
        flex-shrink: 0;
      }
      .list {
        flex: 1;
        display: flex;
        flex-direction: column;
        overflow: hidden;
      }
      >>> .el-icon-edit-outline,
      >>> .el-icon-delete {
        font-size: 16px;
      }
    }
    .right-pane-btn {
      flex-shrink: 0;
      .el-button {
        width: 100%;
      }
    }
  }
  .right-pane {
    width: 350px;
    flex-shrink: 0;
    display: flex;
    flex-direction: column;
    height: calc(100% + 9px);
    overflow: hidden;

    .right-pane-list {
      border: 1px solid #dcdfe6;
      border-radius: 4px;
      flex: 1;
      display: flex;
      flex-direction: column;
      margin-bottom: 10px;
      overflow: hidden;
      .cap {
        height: 38px;
        line-height: 38px;
        display: flex;
        color: #606266;
        font-size: 14px;
        padding: 0 10px;
        flex-shrink: 0;
        justify-content: space-between;
        align-items: center;
        .cap_sys {
          float: right;
          cursor: pointer;
        }
      }
      .table-actions {
        flex-shrink: 0;
      }
      .list {
        flex: 1;
        display: flex;
        flex-direction: column;
        overflow: hidden;
      }
      >>> .el-icon-edit-outline,
      >>> .el-icon-delete {
        font-size: 16px;
      }
    }
    .right-pane-btn {
      flex-shrink: 0;
      .el-button {
        width: 100%;
      }
    }
  }
}
